const App = () => {
  return (
    <div>
      <div>
        <Navbar />
        <About />
      </div>
      <div className='container'>
        <div className='projects'><Projects /></div>
        <div className='contact'><Contact /></div>
        <div><Footer /></div>
      </div>
    </div>
  );
};

export default App;
